import React, { Component } from 'react';
import { DatePicker, Button } from 'antd';

export default class componentName extends Component {
    state = {
        title: '',
        description: '',
        isRadio: 1,
        anonymous: 2,
        deadline: null,
        option: [],
    };
    render() {
        return (
            <div>
                <li>
                    标题：
                    <input type="text" placeholder="请输入标题" />
                </li>
                <li>
                    描述：
                    <input type="text" placeholder="请输入描述" />
                </li>
                <li>
                    是否匿名：
                    <select>
                        <option value="1">匿名</option>
                        <option value="0">署名</option>
                    </select>
                </li>
                <li>
                    单/多选：
                    <select>
                        <option value="1">单选</option>
                        <option value="0">多选</option>
                    </select>
                </li>
                <li>
                    截止日期：{' '}
                    <DatePicker
                        onChange={dateString =>
                            this.setState({ dateTime: new Date(dateString).getTime() })
                        }
                        showTime={true}
                    />
                </li>
            </div>
        );
    }
}
